import React from "react";

const Dashboard = () => {
  return (
    <div
      style={{
        display: "flex",
        minHeight: "100vh",
        background: "#f4f6f8"
      }}
    >
      {/* Left side (Search Box) */}
      <div
        style={{
          width: "300px",
          background: "#fff",
          borderRight: "1px solid #e0e0e0",
          padding: "24px"
        }}
      >
        <h3>Search</h3>
        <input
          type="text"
          placeholder="Type to search..."
          style={{
            width: "100%",
            padding: "10px",
            border: "1px solid #ccc",
            borderRadius: "6px"
          }}
        />
      </div>

      {/* Right side (Main Content) */}
      <div
        style={{
          flex: 1,
          padding: "32px",
          display: "flex",
          flexDirection: "column",
          gap: "24px"
        }}
      >
        <h2>Dashboard Heading</h2>
        {/* Add more containers/boxes as you want */}
        <div
          style={{
            background: "#fff",
            borderRadius: "8px",
            padding: "20px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.03)"
          }}
        >
          {/* You can put any content in this box */}
          <h4>Heading inside box</h4>
          <p>Add your content here.</p>
        </div>
        {/* Add more boxes below if needed */}
      </div>
    </div>
  );
};

export default Dashboard;
